import { Tabs, H2, Table, Link } from 'govuk-react';
import { useNavigate, useRouteMatch } from 'react-router-dom';

import DRTab from './De-Register/DRTab';
import BookTab from './BookAppointment/BookTab';
import ViewTab from './ViewAppointment/ViewTab';
import DoctorTab from './DoctorsAvailable/DoctorTab';

function GPTabs() {
  const navigate = useNavigate();
  const match = useRouteMatch();

  return (
    <Tabs>
      <Tabs.Title>Contents</Tabs.Title>
      <Tabs.List>
        <Tabs.Tab as={Link} selected={match.url === '/'} to="/">
          Doctors at GP
        </Tabs.Tab>
        <Tabs.Tab as={Link} selected={match.url === '/BookTab'} to="/BookTab">
          Book Appointment
        </Tabs.Tab>
        <Tabs.Tab onClick={() => navigate('/View-or-cancel-appointments')}>
          View/Cancel Appointment
        </Tabs.Tab>
        <Tabs.Tab onClick={() => navigate('/De-register')}>De-Register</Tabs.Tab>
      </Tabs.List>

      {match.url === '/' && <DoctorTab />}
      {match.url === '/BookTab' && <BookTab />}
      {match.url === '/View-or-cancel-appointments' && <ViewTab />}
      {match.url === '/De-register' && <DRTab />}
    </Tabs>
  );
}

export default GPTabs;
